    ll n; cin >> n;
    if(n >= MOD) {
        cout << "0\n";
        return;
    }
    ll start = precompute[n / SQRT_N];
    for(ll i = n / SQRT_N * SQRT_N + 1; i <= n; i++) {
        start *= i;
        start %= MOD;
    }
    cout << start << '\n';
